table.sort(pet_keys, function(a,b)
    local ma = pets[a]
    local mb = pets[b]
    if (ma._petType == mb._petType) then
        if (ma._petRequiredCha == mb._petRequiredCha) then
            return ma._name < mb._name
        end
        return ma._petRequiredCha < mb._petRequiredCha
    end
    return ma._petType < mb._petType
end)

function populatePetList()
    local petList = document:getElementById("petChoice")   
    for i=1,#pet_keys do
        local d = pets[pet_keys[i]]
        local option = document:createElement("option")
        option.text = d._name
        if (d._location and #d._location > 0) then
            local locales = table.concat(d._location,", ")
            option.text = option.text .. " <" .. locales .. ">"
        end
        if (d._petType == 4) then 
            option.text = "[Merc] " .. option.text
        else
            option.text = option.text .. " ["..d._petRequiredCha.."]"
        end
        option.value = pet_keys[i]
        petList:add(option)
    end
end

function updateStats()
    local endtext = ""
    local choice = tonumber(document:getElementById("petChoice").value)
    local level = tonumber(document:getElementById("level_slider").value)
    local charisma = tonumber(document:getElementById("charisma_slider").value)
    local archer_any = document:getElementById("archerCheck").checked
    local archer_rank = tonumber(document:getElementById("archerPassive").value)
    local archer_active_rank = tonumber(document:getElementById("archerActive").value)
    local valid = true
    if (not choice or choice == "") then
        valid = false
    elseif (not level or not tonumber(level) or level < 1 or level > 500) then
        valid = false
    elseif (not charisma or not tonumber(charisma) or charisma < 1 or charisma > 500) then
        valid = false
    end
    if (not valid) then
        document:getElementById("stats_div").innerHTML = endtext
        return
    end
    local d = pets[choice]
    endtext = endtext .. ("* {"..d._name .. "} #"..choice.." (Tier "..d._petTier.." "..petTypes[d._petType].." style "..d._petDisposition..") at Lv."..level.." with "..charisma.." charisma:")
    if (charisma < d._petRequiredCha and d._petType == 1) then
        endtext = endtext .. [[<br><font color="#FF0000">WARNING: Can't summon with this charisma</font>]]
    elseif (d._petType == 4) then
        if (archer_any and archer_rank) then
            endtext = endtext .. [[<br><font color="#DD0044">Note: Mercenaries are unaffected by player charisma and Enhanced Training</font>]]
        else
            endtext = endtext .. [[<br><font color="#DD0044">Note: Mercenaries are unaffected by player charisma</font>]]
        end
    end

    local totalStats = {}
    local st_cha = petCharisma[charisma]
    local st_stats = petLevels[level]
    local disp = d._petDisposition
    local tier = d._petTier
    for j=1,#st_cha do
        totalStats[j] = st_stats[j]
        -- charisma bonus only applies to pets, not mercs
        if (d._petType == 1) then totalStats[j] = totalStats[j] + st_cha[j] end
        totalStats[j] = math.floor(totalStats[j] * petDispositions[disp][j])
        totalStats[j] = math.floor(totalStats[j] * petTiers[tier][j])
        local atkMult = nil
        local atkFlat = nil
        if (archer_any and d._petType == 1) then
            if (archer_rank) then
                if ((j == 1 or j == 2)) then  -- atkMin/atkMax
                    atkMult = (atkMult or 0) + archerPassive[archer_rank].power
                end
            end
            if (archer_active_rank) then
                if (j == 1 or j == 2) then -- 
                    atkFlat = (atkFlat or 0) + (archerActive[archer_active_rank].flat or 0)
                    atkMult = (atkMult or 0) + (archerActive[archer_active_rank].power)
                elseif (j == 4) then -- critical
                    totalStats[j] = totalStats[j] + (archerActive[archer_active_rank].crit or 0)
                end
            end
        end
        if (j == 1 or j == 2) then -- atk buffs hoooo
            if (atkFlat and atkFlat > 0) then
                totalStats[j] = math.floor(totalStats[j] + atkFlat)
            end
            if (atkMult and atkMult > 0) then
                totalStats[j] = math.floor(totalStats[j] + (totalStats[j] * (charisma * atkMult)))
            end
        end
        if (j == 4) then
            endtext = endtext .. ("<br>    - %s: %s%%"):format(statNames[j],(totalStats[j]/10))
        else
            endtext = endtext .. ("<br>    - %s: %s"):format(statNames[j],totalStats[j])
        end
    end
    endtext = endtext .. "<br><br>"
    endtext = endtext .. "Style "..disp.." affects the stats in the following way (already calculated above):<br>"
    for j=1,#st_cha do
        endtext = endtext .. "- " .. statNames[j] .. ": " .. petDispositions[disp][j] .. "x"
        --if (j == 5 or j == #st_cha) then
            endtext = endtext .. "<br>"
        --else
        --    endtext = endtext .. "/"
        --end
    end
    document:getElementById("stats_div").innerHTML = endtext
end

function updateBoxFromSlider(ele,ele2)
    local this = ele
    ele2.value = this.value;
    updateStats();
end
function updateSliderFromBox(ele,ele2,def_val)
    local this = ele
    if (this.value == "") then return end
    local v = tonumber(this.value)
    if (not tonumber(v)) then this.value = def_val v = def_val end
    if (v < 1) then this.value = 1 end -- zero is not legal
    if (v > 500) then this.value = 500 end
    ele2.value = this.value;
    updateStats();
end

